comment: |-
  SELECT T1.student_id,
         T1.first_name,
         T1.middle_name,
         T1.last_name,
         count(*),
         T1.student_id
  FROM Students AS T1
  JOIN Student_Enrolment AS T2 ON T1.student_id = T2.student_id
  GROUP BY T1.student_id
  ORDER BY count(*) DESC
  LIMIT 1

